        <p>
            Choose your favourite meal from our broad selsction of available meals and enjoy a delicious lunch or dinner at home

        </p>
        <p>
            All our meals are cooked with high-quality ingredients,just-in-time and of course by experenced chefs!
        </p>
    </section>
    )



}

export default MealsSummary;
